	overflow: hidden;
	width: 100px;
	height: auto;
	font-size: 64px;
	font-family: "Poppins";
	font-weight: var(--wgt-700);
	position: absolute;
	z-index: 999;
	top: 50%;
	left: 50%;
	animation: rotation 3.5s infinite linear;
	pointer-events: none;
	transition: top 0.5s, left 0.5s;
	transition-timing-function: ease-out;
}
//Document Styling

a {
	text-decoration: none !important;
}
h1 {
	text-align: center;
	color: var(--clr-neutral-black-400) !important;
	font-size: var(--fs-800) !important;
	font-weight: var(--wgt-700) !important;
	text-transform: uppercase;
	user-select: none;
	line-height: 200px;
}

